import React from 'react';
import './doorGame.css';

const images = {
    closedDoor: './closed_door.svg'
}

class doorGame extends React.Component{

    render(){
        return (
            <div className="door-row">
                <img id="door1" className="door-frame" src={images.closedDoor}/>
                <img id="door2" className="door-frame" src="https://content.codecademy.com/projects/chore-door/images/closed_door.svg"/>
                <img id="door3" className="door-frame" src="https://content.codecademy.com/projects/chore-door/images/closed_door.svg"/>
          </div>
        );
    }
}

export default doorGame;
